import "./login.css";
import { BrowserRouter as Router } from 'react-router-dom';

function Login() {

    const responseLogin = (response) => {
        console.log(response);
        window.location='/twitter';
    }

    return (
        <div className="login">
            <Router>
                <div className="auth-wrapper">
                    <div className="auth-inner">
                        <form>
                            <h3>Inicio de Sesion</h3>

                            <div className="form-group">
                                <label>Correo Electronico</label>
                                <input type="email" className="form-control" placeholder="Correo electronico" />
                            </div>

                            <div className="form-group">
                                <label>Contraseña</label>
                                <input type="password" className="form-control" placeholder="Contraseña" />
                            </div>
                            <br></br>

                            <button type="submit" className="btn btn-info btn-block bg-primary" to={"/twitter"}>INICIAR SESION</button>
                        </form>
                    </div>
                </div>
            </Router>
        </div>
    );
}

export default Login;
